          className="profile-card"
onClick={() => navigate(`/profile?user=${p.key}`)}          whileHover={{ y: -8 }}
          transition={{ type: 'spring', stiffness: 300 }}
        >
          <img src="/icon1.png" alt="Yazan Dawud" />
          <h3>Yazan Dawud</h3>
          <p>Software Engineer</p>
        </motion.div>
      </div>
    </div>
);
}
